PRIVATLEASINGKAMPANJ! 36MÅN/3000MIL! SERVICE INGÅR! INGEN FÖRSTA BETALNING! KÖP TILL EV EXTRAMIL! OLIKA FÄRGER! EV METALLICLACK TILLKOMMER! 12, 3tum Digital förardisplay ; 2 - Zons Automatisk klimatanläggning; 8tum Pekskärm med Mirror
Screen (Apple CarPlay™, MirrorLink® & förberett för Android Auto); Adaptiv farthållare; Automatiskt
avbländande innerbackspegel; Automatistk halvljus; Citroën Connected 3D Navigation;
Dödavinkelvarnare; Elektrisk parkeringsbroms; Elektriska fönsterhissar fram & bak; Elektriskt
justerbart förarsäte; Hastighetsskyltsavläsare & rekommenderad hastighet; Helljustassistent; Highway
