bak med 180o backkamera; Trafik- och hastighetsskyltsavläsning;
Funktion
18tum Aluminiumfälgar; Dimljus fram med kurvljus; Elinfällbara ytterbackspeglar med defrostfunktion;
Flexibelt baksäte (3 individuellt skjutbara & justerbara bakstäten); LED bakljus med 3D effekt; LED
Strålkastare & varselljus; Mörktonade bakre sidorutor och bakruta; Takrails; Vindrutetorkare med
Magic Wash; Öppningsbart panoramaglastak med solgardin;
Exteriör
8 airbags (fram, ASR - Antispinnsystem; Active Safety Brake - autobroms från 5
km/h upp till 85 km/h; Aktiv avåkningsvarnare (från 65 km/h) ; Aktiv trötthetskontroll; Citroën Connect
Box (nödanrop med lokalisering & assistanssamtal); Dödavinkelvarnare; ESP - Antisladdsystem;
Highway Driver Assist (automatisk anpassning av bilens hastighet & färdrikning); ISOFIX-fästen i
främre passagerarstol; ISOFIX-fästen på yttre platser i baksäte; Kollisionsvarnare;
Säkerhet
Aktivt kolfilter och Air Quality System som renar luften i kupén; Fjädring med Progressive Hydraulic
Cushions® (PHC);
Övrigt
Akustiskt laminerade rutor; Justerbar rattstång i djup och höjd; Justerbart svankstöd på förarstol;
Läderklädd multifunktionsratt; Svart Alcantara- & konstläderklädsel; Sätesvärme fram;
